CREATE PROCEDURE GenerateDummyRows\nAS\nBEGIN\n    DECLARE @maxWorkOrderNumber INT\n    SELECT @maxWorkOrderNumber = MAX(work_order_number) FROM WorkOrders\n\n    WHILE @maxWorkOrderNumber < (SELECT MAX(work_order_number) FROM WorkOrders)\n    BEGIN\n        INSERT INTO WorkOrders (work_order_number)\n        VALUES (@maxWorkOrderNumber + 1)\n\n        SET @maxWorkOrderNumber = @maxWorkOrderNumber + 1\n    END\nEND\nGO